import React, {useState, useEffect} from "react";
import '../Component/Category.css';
import axios from "axios";
import { Link } from "react-router-dom";

export default function Category(){

    return(
    <>
      <div className="container">
        <br />
        <h3>Pilih Kategori</h3>
        <br />
        <Link to = {'/photos/animals'}>
        <input type="button" className="button-Go" value="hewan" />
        </Link>
        <Link to = {'/photos/plants'}>
        <input type="button" className="button-Go" value="tumbuhan" />
        </Link>
        <Link to = {'/photos/natures'}>
        <input type="button" className="button-Go" value="nature" />
        </Link>
      </div>
      </>
 )
}
